from python_helpers.ph_keys import PhKeys
from python_helpers.ph_util import PhUtil

from amenity_pj.helper.app_handler import set_server_name
from amenity_pj.helper.constants import Const
from amenity_pj.helper.util import Util


def test_set_server_name():
    PhUtil.print_heading()
    hosts_pool = [
        'localhost:5000',
        '127.0.0.1:5000',
        'beta.amenitypj.in',
        'alpha.amenitypj.in',
        'past.amenitypj.in',
        'amenitypj.in',
        'www.amenitypj.in',
        'www.beta.amenitypj.in',
    ]
    for _host in hosts_pool:
        print(f'{PhKeys.BEFORE}{_host}')
        host_name, nav_items = set_server_name(_host)
        print(f'{PhKeys.AFTER}{host_name}')
        print(f'Nav Items: {nav_items}')
        print()


def test_versions():
    PhUtil.print_heading()
    PhUtil.print_version(Const.TITLE_AMENITY_PJ, Const.VERSION_AMENITY_PJ)
    for apj_id in Const.APPS_LIST:
        PhUtil.print_version(Util.get_apj_data(apj_id=apj_id, specific_key=PhKeys.APP_TITLE),
                             Util.get_apj_data(apj_id=apj_id, specific_key=PhKeys.APP_VERSION),
                             no_additional_info=True)


def test_file_name():
    PhUtil.print_heading()
    filename_pool = [
        '../../../../home/username/.bashrc',
        '.txt',
    ]
    for _filename in filename_pool:
        print(f'{PhKeys.BEFORE}{_filename}')
        file_name = Util.sanitize_file_name(_filename)
        print(f'{PhKeys.AFTER}{file_name}')
        print()


def main():
    test_versions()
    test_set_server_name()
    test_file_name()


if __name__ == '__main__':
    main()
